package com.testevr.testejava.cliente.entity;

import com.testevr.testejava.cliente.valueobject.Nome;
import com.testevr.testejava.cliente.valueobject.RazaoSocial;
import com.testevr.testejava.cliente.valueobject.NomeFantasia;
import com.testevr.testejava.cliente.valueobject.Cnpj;

public class ClienteExample {

    public static void main(String[] args) {
        // Exemplo de uso da entidade Cliente
        try {
            // Criando um cliente com nome fantasia
            Cliente cliente1 = new Cliente(
                new Nome("João Silva"),
                new RazaoSocial("João Silva Comércio LTDA"),
                new NomeFantasia("JS Comércio"),
                new Cnpj("11.222.333/0001-81")
            );

            System.out.println("Cliente 1: " + cliente1);
            System.out.println("ID: " + cliente1.getId());
            System.out.println("Nome: " + cliente1.getNome());
            System.out.println("Razão Social: " + cliente1.getRazaoSocial());
            System.out.println("Nome Fantasia: " + cliente1.getNomeFantasia());
            System.out.println("CNPJ: " + cliente1.getCnpj());

            System.out.println("\n" + "=".repeat(50) + "\n");

            // Criando um cliente sem nome fantasia
            Cliente cliente2 = new Cliente(
                new Nome("Maria Santos"),
                new RazaoSocial("Maria Santos Consultoria ME"),
                null, // Nome fantasia pode ser nulo
                new Cnpj("22.333.444/0001-92")
            );

            System.out.println("Cliente 2: " + cliente2);
            System.out.println("ID: " + cliente2.getId());
            System.out.println("Nome: " + cliente2.getNome());
            System.out.println("Razão Social: " + cliente2.getRazaoSocial());
            System.out.println("Nome Fantasia presente: " + 
                (cliente2.getNomeFantasia() != null ? cliente2.getNomeFantasia().isPresente() : false));
            System.out.println("CNPJ formatado: " + cliente2.getCnpj());

        } catch (IllegalArgumentException e) {
            System.err.println("Erro ao criar cliente: " + e.getMessage());
        }
    }
}
